let scanList = '<table><tr><th></th><th></th></tr>';
scans.forEach(detail => {
  scanList += `<tr><td>${detail.eventType}</td><td>${detail.eventDescription}</td><td style="color:red;">${detail.exceptionDescription}</td><td>${detail.scanLocation.city?detail.scanLocation.city:''}</td><td>${detail.scanLocation.stateOrProvinceCode?detail.scanLocation.stateOrProvinceCode:''}</td><td>${detail.scanLocation.postalCode}</td><td style="padding-left:50px;">${detail.date.substring(0,10)}</td><td>${detail.date.substring(11,19)}</td></tr>`;
});
scanList += `</table>`;
main["scanDetailHtml"] = scanList;
